import React from 'react';
import PerfilText from './PerfilText';

const user = {
    src: 'path/to/profile-image.jpg',
    alt: 'Profile Image',
    name: 'John Doe',
    email: 'john.doe@example.com',
    otherInfo: 'Additional information about the user'
};

const posts = [
    { text1: 'Post 1 Text 1', text2: 'Post 1 Text 2', text3: 'Post 1 Text 3' },
    { text1: 'Post 2 Text 1', text2: 'Post 2 Text 2', text3: 'Post 2 Text 3' },
    // more posts...
];

function App() {
    return (
        <div>
            <PerfilText user={user} posts={posts} />
        </div>
    );
}

export default App;
